import { GET_ITEMS, Post_Plan } from "./Types";
import Axios from "axios";

export const getItems = () => (dispatch) => {
  Axios.get("/venders?mealType=veg").then((res) =>
    dispatch({
      type: GET_ITEMS,
      payload: res.data,
    })
  );
};

export const postPlan = (data) => (dispatch) => {
  dispatch({
    type: Post_Plan,
    payload: data,
  });
};
